import React from 'react'
import Img from './img.js'


class Api extends React.Component {
    constructor() {
    super()
    this.state = {
        apiPredictionData: {},
        isLoading: true,
        apiExploraoryData: {},
        urlData : {
            PassengerId:5,
            Pclass:3,
            SexMale:1.0,
            SexFemale:0.0,
            Age:35.0,
            SibSp:0,
            Parch:0,
            Fare:8.0500,
            EmbarkedS:1.0,
            EmbarkedC:0.0,
            EmbarkedQ: 0.0
    },
    url : "/api/predict?"
    }
    this.click = this.click.bind(this)
}


    componentDidMount() {
        let ourl = this.state.url
        let i = 1
        for(let key in this.state.urlData) {
            // console.log(i)
            ourl += "v"+ i++ + "=" + this.state.urlData[key] + "&"
        }
        this.setState({ 
            url: ourl.slice(0,-1)
        })
        fetch("/api")
        .then(response => response.json())
        .then(data => this.setState({
            apiExploraoryData: data,
            isLoading: false
        }))
    }

    handleChange(event) {
        this.setState({
            eve
        })
    }

    predict() {
        console.log("from click: " + this.state.url)
        fetch(this.state.url)
        .then(response => response.json())
        .then(data => this.setState({
            apiPredictionData: data
        }))
    }


    render() {
        console.log("from rneder")
        let url = ""
        url += this.state.apiExploraoryData.figures
        url = url.split(',')
        console.log(url[0])

        const figures = url.map(url => {
            return(
            <Img url={url} />
            )
        })
        return(

            <div className="container">
                <h1>{this.state.apiPredictionData.predicted }</h1>
                <button onClick={this.click}>click</button>
                {/* <Img  url={url[0]}  /> */}
                < hr/>
                <h2 >Exploratory Data Analysis</h2>
                <div className="img-container">
                    {figures}
                </div>
            </div>
        )
    }

}


export default Api
